import React ,{Component} from 'react';


class Users extends Component {
    render(){
        return(
            <div>
                <center>
                <font size='+1.5'>
                <h1>Name:Abhishek</h1>
                <h1>Age:24</h1>
                <h1>Qualification:B.E</h1>
                <h1>Place:Bangalore</h1>
                </font>
                </center>
            </div>
        );
    }
}
export default Users;
